import React from "react";

export default function Card(props) {

  console.log(props)
  return (
    <div className="card">
      <img src={props.imageUrl} className="card--image"></img>
      <section className="card--section">
        <p>{props.location}</p>
        <span>{props.googleMapsUrl}View on Google Maps <a href={props.googleMapsUrl}></a></span>
        <h1>{props.title}</h1>
        <p>{props.description}</p>
      </section>
    </div>
  )
}
